import React from 'react';

const Child = ({ name, properties, parentName }) => {  // Destructure props correctly
    return (
        <div className='properties'>
            <h1>{parentName}</h1>  
            <h2>I am Child Component {name} - {properties}</h2>  
        </div>
    );
};

export default Child;
